import Link from 'next/link';
import Header from '../components/Header';




export default function Index() {
    return (
        <div>
            <Header />
            <p>This is Home page</p>

            <Link href='/contact'>
            <a >Contact</a>
        </Link>
            <style jsx>{`
            body{
                margin: 0,
                padding: 0
            }
            `}
            </style>
        </div>
    )
}
